import React, {
  useState,
  useEffect,
} from "react";

export default function Products() {
  const [products, setProducts] =
    useState([]);
  fetch("data/products.json")
    .then((response) => response.json())
    .then((data) => console.log(data));
  useEffect(() => {}, []);

  return (
    <div>
      <ul>
        {products.map((p) => (
          <li>{p.name}</li>
        ))}
      </ul>
    </div>
  );
}
